 import axios from 'axios';
 import React, {useState, useEffect} from 'react';

const[ordini, setOrdini] = useState([])
  useEffect(() => {
      axios.get('http://127.0.0.1:8000/prodotti/',[])
      .then(res => {
          console.log(res)
          setOrdini(res.data)
          console.log(ordini.data)
      },)
      .catch(err =>{
          console.log(err)
      })
  },[])

  const data = {

    products: 
    ordini.map()
          
        
  }

export default data;
